import React, {useEffect, useState} from "react";
import {useHttp} from "../hooks/http.hook";
import {useHistory} from "react-router-dom";

export const QuestionPage =() => {
    const {loading, request} = useHttp()
    const [response, setResponse] = useState ('')
    const history = useHistory()

    // Зибраем данные объектов с сервера при загрузки страницы
    useEffect(() => {

        const fetchData = async () => {
            const data = await request('/api/v1/model/demo/create', 'GET', )
            console.log(data)

            setResponse(data);
        };

        fetchData();
    }, []);

    const questionHandler_1 = async () => {
        try {

            // Добавляем в объект ответ по новому ключу answer
            var r = response
            r['answer'] = 1
            setResponse(r)

            const body = response
            var data = await request('http://127.0.0.1:8000/api/v1/question', 'POST', body)
            setResponse(data)

            console.log('data')
            console.log(data.flag_find_winner)
            setResponse(data)
            console.log('response')
            console.log(response.flag_find_winner)
        }
        catch (e) {}
    }

    const questionHandler_0 = async () => {
        try {

            // Добавляем в объект ответ по новому ключу answer
            var r = response
            r['answer'] = 0
            setResponse(r)

            const body = response
            var data = await request('http://127.0.0.1:8000/api/v1/question', 'POST', body)
            setResponse(data)

            console.log('data')
            console.log(data.flag_find_winner)
            setResponse(data)
            console.log('response')
            console.log(response.flag_find_winner)
        }
        catch (e) {}
    }

    const questionHandler_2 = async () => {
        try {

            // Добавляем в объект ответ по новому ключу answer
            var r = response
            r['answer'] = 2
            setResponse(r)

            console.log('response до запроса')
            console.log(response.flag_find_winner)
            console.log(response.option_2)

            const body = response

            var data = await request('http://127.0.0.1:8000/api/v1/question', 'POST', body)
            console.log('data')
            console.log(data.flag_find_winner)
            console.log(data.option_2)
            setResponse(data)
            console.log('response')
            console.log(response.flag_find_winner)
            console.log(response.option_2)

            if (data.flag_find_winner == 1){
                console.log('Вошли 1')
                console.log(response.flag_find_winner)
                try {
                    console.log('Вошли 2')
                    history.push(`/model/result/${response.id}`)
                    console.log('Вошли 3')
                } catch (e) {console.log('Вошли 4')}
            }
        }
        catch (e) {}
    }
    return (
        <div>
            <h3>Ответьте на вопрос:</h3>
            <div className="row">
                <div className="col s12">
                    <div className="card blue-grey darken-1">
                        <div className="card-content white-text">
                            <span className="card-title">{response.question}</span>
                        </div>
                        <div className="card-action">
                            <button
                                className='btn auth-btn-custom'
                                onClick={questionHandler_1}
                                disabled={loading}
                            >Важнее 1ое преимущество</button>
                            <button
                                className='btn auth-btn-custom'
                                onClick={questionHandler_0}
                                disabled={loading}
                            >Одинаково важны</button>
                            <button
                                className='btn auth-btn-custom'
                                onClick={questionHandler_2}
                                disabled={loading}
                            >Важнее 2ое преимущество</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
